// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract DormitoryQuest {
    uint constant DURATION = 3 days;
    address owner;

    struct Student {
        uint id;
        string fullName;
        bool sheetsDone;
        bool roomDone;
        bool booksDone;
        uint regDate;
        uint deadlineDate;
    }

    Student[] students;

    event SummonsToArmyGiven(string name);
    event StudentEvicted(string name, uint date);
    event StudentAdded(uint id, string name, uint regDate);

    constructor() {
        owner = msg.sender;
    }

    modifier OwnerOnly(address _to) {
        require(msg.sender == owner, "You are not the owner.");
        require(_to != address(0), "Incorrect address!");
        _;
    }

    function addStudent(address _to, string calldata _name, bool _sheetsDone, bool _roomDone, bool _booksDone) public OwnerOnly(_to) {
        uint currentId = students.length == 0 ? students.length : students.length - 1;

        Student memory newStudent = Student({
            id: currentId,
            fullName: _name,
            sheetsDone: _sheetsDone,
            roomDone: _roomDone,
            booksDone: _booksDone,
            regDate: block.timestamp,
            deadlineDate: block.timestamp + DURATION
        });

        students.push(newStudent);

        emit StudentAdded(newStudent.id, newStudent.fullName, newStudent.regDate);
    }

    function debtsAreDone(Student memory _student) public {
        if (_student.sheetsDone == false)
        {
            emit SummonsToArmyGiven(_student.fullName);
        }

        if (_student.roomDone == false)
        {
            emit SummonsToArmyGiven(_student.fullName);
        }

        if (_student.booksDone == false)
        {
            emit SummonsToArmyGiven(_student.fullName);
        }

        if (_student.regDate + DURATION > block.timestamp)
        {
            emit SummonsToArmyGiven(_student.fullName);
        }

        emit StudentEvicted(_student.fullName, block.timestamp);
    }
}

